/* eslint-disable */
/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmFile 
} from '@vime/core';

import { define } from '../lib';


define('vm-file', VmFile);


export interface FileProps extends JSX.VmFile, HTMLAttributes<HTMLVmFileElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmFileElement, FileProps>(
  'vm-file',
  new Set(['willAttach','crossOrigin','preload','poster','mediaTitle','controlsList','autoPiP','disablePiP','disableRemotePlayback','viewType','playbackRates','language','autoplay','controls','logger','loop','muted','playsinline','noConnect','paused','currentTime','volume','playbackReady','playbackStarted','currentTextTrack','hasCustomTextManager','isTextTrackVisible','shouldRenderNativeTextTracks']),
);
